import Emptable from "./employetable";
import { BrowserRouter as Router, Routes, Route, Link } from "react- router-dom";

function App14() {
    return (
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<employetable />} />
                </Routes>
            </Router>
        </div>
    )
}
export default App14;
